import React from 'react';
import {
    NavLink
  } from "react-router-dom";

const NavLinks = (props) => {
    return(
        <div className='navlinks-container'>
            <div className='navlinks'>
                <NavLink to='/' exact>Home</NavLink>
            </div>
        </div>
    )
}

export default NavLinks;
